import { useEffect } from "react";
import { useState } from "react";
import logo from ".././bg-mobile-dark.jpg";
import "./countryCard.css";
function CountryCards({ query }) {
  const [countriess, setCountries] = useState([]);
  const searchCountry = async (title) => {
    try {
      const response = await fetch(
        `https://restcountries.com/v3.1/name/${title}`
      );
      const data = await response.json();
      console.log(data);
      data.map((dat) => {
        setCountries(dat);
      });
    } catch (error) {
      console.log(error.message);
    }
  };
  useEffect(() => {
    searchCountry(query);
  }, []);
  return (
    <>
      <div className="card-container">
        return (
        <div className="card">
          <div>
            <img className="image" alt="flag" src={logo} />
          </div>
          <div className="card-text">
            <h2>{countries.name.common}</h2>
            <div className="flexit">
              <p>Population:</p>
              <span>400,000</span>
            </div>
            <div className="flexit">
              <p>Region:</p>
              <span>Europe</span>
            </div>
            <div className="flexit">
              <p>Europe:</p>
              <span>Berlin</span>
            </div>
          </div>
        </div>
        );
      </div>
    </>
  );
}
export default CountryCards;
